import {
  SearchBar,
  SearchForm,
  SearchFormButton,
  SearchFormInput,
} from './styled';
import { Formik } from 'formik';
import { GoSearch } from 'react-icons/go';

export const Searchbar = () => {
  return (
    <SearchBar>
      <Formik>
        <SearchForm>
          <SearchFormButton type="submit">
            <GoSearch size={'23px'} />
          </SearchFormButton>

          <SearchFormInput
            type="text"
            autocomplete="off"
            autofocus
            placeholder="Search images and photos"
          />
        </SearchForm>
      </Formik>
    </SearchBar>
  );
};
